import ExpenseItem from "./components/ExpenseItem";
import Card from "./components/Card";

function Expense(props){
    return (
        <Card className='expense-item'>
            <ExpenseItem ExpenseItem ={props.ExpenseItem}/>
        </Card>
    );
}
export default Expense;
